import React, { useMemo, useCallback } from 'react';
import { useState, useEffect } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Switch, Route } from 'react-router-dom';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import CssBaseline from '@material-ui/core/CssBaseline';
import Head from './head';
import Get from './Get';
import ButtonGroup from './ButtonGroup';
import CardLoad from '../../componentes/CardLoad';

const useStyles = useMemo(() =>
  makeStyles((theme) => ({
    root: {
      flexGrow: 1,
      maxWidth: '50%',
    },
    bullet: {
      display: 'inline-block',
      margin: '0 2px',
      transform: 'scale(0.8)',
    },
    title: {
      fontSize: 14,
    },
    pos: {
      marginBottom: 12,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
  })),
);

const Octavos = React.lazy(() => import('./one'));
const Cuartos = React.lazy(() => import('./two'));
const Semifinal = React.lazy(() => import('./three'));
const Final = React.lazy(() => import('./four'));

export default function One() {
  const classes = useStyles();
  const url =
    'https://opensheet.elk.sh/1EUmIOwosuGTI7L2DD6S02RjOG7vbxU3FjVVD1u-iYiw/Manual!A1:K9';
  const [todos, setTodos] = useState();

  const MemoizedGet = useMemo(() => React.memo(Get), []);
  const fetchApi = useCallback(async () => {
    const response = await fetch(url);
    const responseJSON = await response.json();
    setTodos(responseJSON);
  }, [url]);
  useEffect(() => {
    fetchApi();
  }, [fetchApi]);

  return (
    <React.Fragment>
      <CssBaseline />
      <Container maxWidth="sm">
        <Head />
        <ButtonGroup />

        <Grid container spacing={3}>
          <Grid item xs={12}>
            <Typography variant="h6" component="h3">
              Octavos de final
            </Typography>
          </Grid>
          {!todos ? (
            <Grid item xs={12}>
              <CardLoad />
            </Grid>
          ) : (
            todos.map((todo, index) => {
              return (
                <Grid item xs={12}>
                  <MemoizedGet {...todo} />
                </Grid>
              );
            })
          )}
          <Switch>
            <Route path="/mundial/round1" component={Octavos} />
            <Route path="/mundial/round2" component={Cuartos} />
            <Route path="/mundial/round3" component={Semifinal} />
            <Route path="/mundial/round4" component={Final} />
          </Switch>
        </Grid>
      </Container>
    </React.Fragment>
  );
          }
